import React, {Component} from 'react';

export class index extends Component {
	style = {backgroundColor: 'white', color: 'white'};
	render() {
		return (
			<div className="dashboard-header ">
				<nav className="navba fixed-top" style={{backgroundColor: '#d41872'}}>
					<a className="navbar-brand  centered" href="index.html" style={this.style}>
						<span>list of insta</span>
						<i className="material-icons">instagram</i>
					</a>

					{/* <a href="/" className="btn btn-primary navbar-right-top m-2  btn-icon">
						<i className="material-icons">home</i>
						<span>خانه</span>
					</a>

					<a href="/auth/logout" className="btn btn-danger navbar-right-top m-2 btn-icon">
						<i className="material-icons">lock_open</i>
						<span>خروج</span>
					</a> */}
				</nav>
			</div>
		);
	}
}

export default index;
